import React from 'react';
import { Container, Content } from './styles';

interface IModalProps {
  isOpen: boolean;
  setIsOpen: () => void;
  children: any;
}

const Modal: React.FC<IModalProps> = ({ children, isOpen, setIsOpen }) => {
  if (isOpen) {
    return (
      <Container>
        <Content>{children}</Content>
      </Container>
    );
  }
  return <> </>;
};

export default Modal;
